import Axios from "axios";
import "./Radar.modules.css"
import { useState } from "react";
import fotoRadar from "../img/jinx.jpeg"
import iconeCurtir from "../img/iconeHeart.png"

function Radar( { user, id, likes, text, image} ){
    const [postList, setPostList] = useState([]);
    let posts = [];
    
    //console.log(image)
    if (image === null){
        image = "";
    }

    return (
        <>
           {/** Caixa Radar 01*/}
          <div className="radar">
            {/** user e botao seguir*/}
            <div className="userRadar">
              <div className="userPostR"><p>@{user}</p></div>
              <div className="btnSeguir"><p>Seguir</p></div>
            </div>
            {/** foto do radar*/}
            <div className="postRadar">
              <div className="jogo">
                <p>{text}</p>
                <img src={image} alt="..." width="100%" />
              </div>
            </div>
            {/** likes do post*/}
            <div className="acoesRadar">
              <div className="btnCurtir">
                <img src={iconeCurtir} alt="..." width="15px" />
              </div>
              <div className="txtLikes">
                <p>{ likes }</p>
              </div>
            </div>
          </div>
        </>
    )
}

export default Radar;
